import React from 'react'
import './IngredientsBox.css'

const IngredientsBox = (props) => {
  const {recipe}=props; 
  return (
    <div className='ingredientsbox'>
      <div className="ingredientsbox-navigator">
        <div className="ingredientsbox-description">
          <div className="ingredientsbox-nav-box">Suroviny</div>
          <ul>
          {recipe.ingredients.map((item,index)=>{
            return(<li key={index}>{item}</li>)
          })}
          </ul>
        </div>
    </div>
        <div className='preparations'>
          <div className="preparations-desc">
          <div className="preparations-nav-box">Postup přípravy</div>
            <ul>
            {recipe.preparation_process.map((item,index)=>{
            return(<li key={index}>{item}</li>)
          })}
            </ul>
            </div>
        </div>
    </div>
    
  )
}

export default IngredientsBox
